import React, { Component } from 'react'

class HoverCounterTwo extends Component {
    render() {
        const { count } = this.state
        return (
            <div>
                <h2 onMouseOver={this.incrementCount}>Hovered over {count} times</h2>
            </div>
        )
    }
}

export default HoverCounterTwo
